$table_exceptions = array('sequences','pkeys','indicies','all_mps','all_marking_periods','external_programs','CUSTOM_FIELDS','FIELD_CATEGORIES_JOIN_SCHOOLS','SCHOOLS','STUDENT_ENROLLMENT_CODES','STUDENT_MEDICAL','STUDENT_MEDICAL_ALERTS','STUDENT_MEDICAL_VISITS','STUDENT_FIELD_CATEGORIES','STUDENT_FIELDS_JOIN_CATEGORIES','STUDENT_LOG_ENTRIES');

foreach($metadata as $table=>$md_cols)
{
	if(strtoupper(substr($table,0,3))=='GL_' || in_array($table,$table_exceptions) || strtoupper(substr($table,0,13))=='FLORIDA_STAFF')
		continue;

	//echo $table;
	//print_r($md_cols);
	//exit;
	$current_site_cols[$table] = db_properties($table);
	if(!count($current_site_cols[$table]))
	{
		$errors[] = 'Missing table: '.$table;
		$query = 'create table '.$table.' (';
		foreach($md_cols as $md_col=>$md_col_info)
		{
			if(in_array($md_col_info['TYPE'],array('DATE','INT','BOOL')))
				unset($md_col_info['SIZE']);
			if(in_array($md_col_info['TYPE'],array('INT4','INT8')))
			{
				unset($md_col_info['SIZE']);
				$md_col_info['TYPE'] = 'INT';
			}

			$query .= $md_col.' '.$md_col_info['TYPE'].($md_col_info['SIZE'] && $md_col_info['SIZE']!=65535?'('.$md_col_info['SIZE'].')':'').',';
		}
		$query = substr($query,0,-1);
		$query .= ')';
		$sql[] = $query;
	}
	else
	{
		foreach($md_cols as $md_col=>$md_col_info)
		{
			if(strtoupper(substr($md_col,0,7))=='CUSTOM_')
				continue;
			if(in_array($md_col_info['TYPE'],array('DATE','INT','BOOL')))
				unset($md_col_info['SIZE']);
			if(in_array($md_col_info['TYPE'],array('INT4')))
			{
				unset($md_col_info['SIZE']);
				$md_col_info['TYPE'] = 'INT';
			}
			if(in_array($md_col_info['TYPE'],array('INT8')))
			{
				unset($md_col_info['SIZE']);
				$md_col_info['TYPE'] = 'BIGINT';
			}

			if($current_site_cols[$table][$md_col]['TYPE']=='INT4')
				$current_site_cols[$table][$md_col]['TYPE'] = 'INT';

			if($current_site_cols[$table][$md_col]['TYPE']=='INT8')
				$current_site_cols[$table][$md_col]['TYPE'] = 'BIGINT';

			if(!$current_site_cols[$table][$md_col])
			{
				$errors[] = 'Missing column: '.$table.'-'.$md_col;
				$sql[] = "alter table ".$table." add ".$md_col.' '.$md_col_info['TYPE'].($md_col_info['SIZE'] && $md_col_info['SIZE']!=65535?'('.$md_col_info['SIZE'].')':'');
			}
			elseif($current_site_cols[$table][$md_col]['TYPE']!=$md_col_info['TYPE'])
			{
				$errors[] = 'Type Mismatch: '.$table.'-'.$md_col.'.  Is '.$current_site_cols[$table][$md_col]['TYPE'].'.  Should be '.$md_col_info['TYPE'];
				$sql[] = "alter table ".$table." alter column ".$md_col." set data type ".$md_col_info['TYPE'].($md_col_info['SIZE'] && $md_col_info['SIZE']!=65535?'('.$md_col_info['SIZE'].')':'').($md_col_info['TYPE']=='DATE'?' USING(CAST('.$md_col.' as date))':'');
			}
		}
	}
}

