$primary_col_name = array('SCHEDULE_REQUESTS'=>'REQUEST_ID','ADDRESS'=>'ADDRESS_ID','PEOPLE'=>'PERSON_ID','STUDENTS'=>'STUDENT_ID','USERS'=>'STAFF_ID','APPLICATION_LAYOUT'=>'APPLICATION_ID','APPLICATION'=>'APPLICATION_ID','CUSTOM_FIELDS'=>'CUSTOM_SEQ','SCHOOL_PERIODS'=>'PERIOD_ID','GRADEBOOK_ASSIGNMENTS'=>'ASSIGNMENT_ID','GRADEBOOK_ASSIGNMENT_TYPES'=>'ASSIGNMENT_TYPE_ID','ATTENDANCE_CALENDARS'=>'CALENDAR_ID','DISCIPLINE_REFERRALS'=>'REFERRAL_ID','COURSE_SUBJECTS'=>'SUBJECT_ID','LETTER_TRIGGERS'=>'TRIGGER_ID','MASTER_COURSES'=>'COURSE_ID','STUDENT_ELIGIBILITY_ACTIVITIES'=>'ACTIVITY_ID');
$where_exception['CUSTOM_FIELDS'] = ' WHERE ID<20009001';
$where_exception['DISCIPLINE_REFERRALS_FIELDS'] = ' WHERE ID<2000001';
$where_exception['STANDARDS'] = ' where id<1000000000';
$where_exception['STANDARD_CATEGORIES_3'] = ' where id<1000000000';
$where_exception['STANDARD_CATEGORIES_2'] = ' where id<1000000000';
$where_exception['STANDARD_CATEGORIES_1'] = ' where id<1000000000';
$where_exception['USER_FIELDS'] = ' where id<20120001';

foreach($metadata['sequences'] as $sequence)
{
	if(in_array(strtoupper(substr($sequence,0,3)),array('GL_')))
		continue;

	if(!$current_seqs[$sequence])
		$sql[] = 'create sequence '.$sequence.' start with 1';
	elseif($DatabaseType=='postgres')
	{
		if(in_array($sequence,$skip_seq_check))
			continue;

		if(strpos(strtolower($sequence),'_seq')!==false)
		{
			if(strtolower($sequence)=='custom_seq')
				$table = 'CUSTOM_FIELDS';
			else
				$table = substr($sequence,0,strpos(strtolower($sequence),'_seq'));
			$id_col = false;
			if($primary_col_name[$table])
				$id_col = $primary_col_name[$table];
			elseif($current_site_cols[$table]['ID'])
				$id_col = 'ID';
			elseif($current_site_cols[$table][$table.'_ID'])
				$id_col = $table.'_ID';
			elseif($current_site_cols[$table][substr($table,0,-1).'_ID']) // strip off the s
				$id_col = substr($table,0,-1).'_ID';

			if($id_col)
			{
				$max_RET = DBGet(DBQuery("SELECT MAX(".$id_col.") as MAX FROM ".$table.$where_exception[strtoupper($table)]));
				if($max_RET[1]['MAX'])
				{
					$last_val_RET = DBGet(DBQuery("SELECT last_value FROM ".$sequence));
					if($max_RET[1]['MAX']>$last_val_RET[1]['LAST_VALUE'])
					{
						$errors[] = $sequence.' is off';
						$sql[] = "alter sequence ".$sequence." restart with ".($max_RET[1]['MAX']+1);
					}
				}
			}
		}
	}
}


$current_indicies = db_indicies();
