	if(strtoupper(substr($cols['TABLENAME'],0,3))=='GL_' || in_array($cols['TABLENAME'],$table_exceptions) || strtoupper(substr($cols['TABLENAME'],0,13))=='FLORIDA_STAFF')
		continue;

	if(!$current_indicies[$index_name])
		$sql[] = 'create '.($cols['UNIQUE']==1?'UNIQUE ':' ').'index'.($DatabaseType=='postgres'?' CONCURRENTLY ':' ').$index_name.' ON '.$cols['TABLENAME'].' ('.$cols['COLS'].')';

}

