		{
			case 'text':
			case 'file':
			case 'select':
			case 'select_one':
			case 'signature':
				$type = 'varchar(255)';
				$base_type = 'varchar';
			break;

			case 'textarea':
			case 'multiple':
				$type = 'text';
			break;

			case 'radio':
				$type = 'varchar(1)';
				$base_type = 'varchar';
			break;

			case 'numeric':
				$type = 'numeric';
			break;

			case 'date':
				$type = 'date';
			break;
		}

		if($DatabaseType=='mssql' && $type=='text')
		{
			$type = 'varchar(max)';
			$base_type = 'varchar';
		}

		if(!$base_type)
			$base_type = $type;

		if(!$students_properties['CUSTOM_'.$field['ID']])
		{
			$sql[] = "alter table students add custom_".$field['ID'].' '.$type;
		}
		elseif(strtoupper($base_type)!=strtoupper($students_properties['CUSTOM_'.$field['ID']]['TYPE']))
		{
			if(strtoupper($students_properties['CUSTOM_'.$field['ID']]['TYPE'])=='VARCHAR')
				$sql[] = "update students set custom_".$field['ID']." =null where char_length(custom_".$field['ID'].")<1 and custom_".$field['ID']." is not null";
			$sql[] = "alter table students alter column custom_".$field['ID'].' set data type '.$type.' using (cast(custom_'.$field['ID'].' as '.$type.'))';
		}
	}

	if(!$base_type)
		$base_type = $type;

	if(!$students_properties['CUSTOM_'.$field['ID']])
	{
		$sql[] = "alter table students add custom_".$field['ID'].' '.$type;
	}
	elseif(strtoupper($base_type)!=strtoupper($students_properties['CUSTOM_'.$field['ID']]['TYPE']))
	{
		if(strtoupper($students_properties['CUSTOM_'.$field['ID']]['TYPE'])=='VARCHAR')
			$sql[] = "update students set custom_".$field['ID']." =null where char_length(custom_".$field['ID'].")<1 and custom_".$field['ID']." is not null";
		$sql[] = "alter table students alter column custom_".$field['ID'].' set data type '.$type.' using (cast(custom_'.$field['ID'].' as '.$type.'))';
	}
}

echo '<pre>';
print_r($errors);
foreach($sql as $q)
	echo $q.';<BR>';

echo '</pre>';

if($_REQUEST['run_sql']=='Y')
{
	foreach($sql as $query)
	{
		DBQuery($query,null,null,null,true);
	}
	echo '<h3>Done.</h3>';
}
else
	echo '<a href='.$_SERVER['PHP_SELF'].'?run_sql=Y><b>Run</b></a>';

?>
